import { Route,Routes } from 'react-router';
import './App.css';
import NavBar from './components/NavBar';
import Doctor from './components/doctor'
function App() {
  return (
    <Routes>
      <Route >
        <Route path="/" element={<Home />}/>
        <Route path="/doctors" element={<Doctor/>}/>
      </Route>
    </Routes>
  );
}
function Home() {
  return (
    <NavBar />
    )
  }
export default App;
